import React from "react";

const ListItem = () => {
	function handleCheck() {}
	return (
		<div className="item_list">
			<div className="item_list_checkbox">
				<input
					type="checkbox"
					id="item_list_checkbox"
					onClick={handleCheck}
				></input>
			</div>
			<div></div>
			<div></div>
		</div>
	);
};

export default ListItem;
